import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import Products from './component/products';
import Header from './component/header';
import {BrowserRouter, Route, Routes} from 'react-router-dom'

function App() {
  return (
   <BrowserRouter>
    <Routes>
      <Route path='/' element={<Header/>}/>
    </Routes>
   </BrowserRouter>
  );
}

export default App;
